import React from 'react';

const AreasWeServe = () => {
  return (
    <section id="areas-we-serve" className="areas-we-serve-section">
      <div className="container">
        <h2>Areas We Serve</h2>
        <ul>
          <li>St. Louis</li>
          <li>Chicago</li>
          {/* More cities */}
        </ul>
      </div>
    </section>
  );
};

export default AreasWeServe;
